import React, { createContext, useContext, useState, useEffect } from 'react';
import { v4 as uuidv4 } from 'uuid';
import toast from 'react-hot-toast';

const FormContext = createContext();

export const useForm = () => {
  const context = useContext(FormContext);
  if (!context) {
    throw new Error('useForm must be used within a FormProvider');
  }
  return context;
};

export const FormProvider = ({ children }) => {
  const [forms, setForms] = useState([]);
  const [responses, setResponses] = useState([]);
  const [loading, setLoading] = useState(false);

  // Load data from localStorage on mount
  useEffect(() => {
    const storedForms = localStorage.getItem('forms');
    const storedResponses = localStorage.getItem('formResponses');
    
    if (storedForms) {
      setForms(JSON.parse(storedForms));
    }
    
    if (storedResponses) {
      setResponses(JSON.parse(storedResponses));
    }
  }, []);

  // Save data to localStorage whenever it changes
  useEffect(() => {
    localStorage.setItem('forms', JSON.stringify(forms));
  }, [forms]);

  useEffect(() => {
    localStorage.setItem('formResponses', JSON.stringify(responses));
  }, [responses]);

  const createForm = async (formData) => {
    setLoading(true);
    try {
      // Simulate API call
      await new Promise(resolve => setTimeout(resolve, 1000));
      
      const newForm = {
        id: uuidv4(),
        ...formData,
        createdAt: new Date().toISOString(),
        updatedAt: new Date().toISOString(),
        isActive: true
      };

      setForms(prev => [...prev, newForm]);
      toast.success('Form created successfully!');
      return { success: true, form: newForm };
    } catch (error) {
      toast.error('Failed to create form');
      return { success: false, error: error.message };
    } finally {
      setLoading(false);
    }
  };

  const updateForm = async (formId, formData) => {
    setLoading(true);
    try {
      // Simulate API call
      await new Promise(resolve => setTimeout(resolve, 1000));
      
      setForms(prev => prev.map(form => 
        form.id === formId 
          ? { ...form, ...formData, updatedAt: new Date().toISOString() }
          : form
      ));
      
      toast.success('Form updated successfully!');
      return { success: true };
    } catch (error) {
      toast.error('Failed to update form');
      return { success: false, error: error.message };
    } finally {
      setLoading(false);
    }
  };

  const deleteForm = async (formId) => {
    setLoading(true);
    try {
      // Simulate API call
      await new Promise(resolve => setTimeout(resolve, 1000));
      
      setForms(prev => prev.filter(form => form.id !== formId));
      setResponses(prev => prev.filter(response => response.formId !== formId));
      
      toast.success('Form deleted successfully!');
      return { success: true };
    } catch (error) {
      toast.error('Failed to delete form');
      return { success: false, error: error.message };
    } finally {
      setLoading(false);
    }
  };

  const submitResponse = async (formId, responseData, userId) => {
    setLoading(true);
    try {
      // Simulate API call
      await new Promise(resolve => setTimeout(resolve, 1000));
      
      // Check if user already responded to this form
      const existingResponse = responses.find(
        response => response.formId === formId && response.userId === userId
      );
      
      if (existingResponse) {
        throw new Error('You have already responded to this form');
      }

      const newResponse = {
        id: uuidv4(),
        formId,
        userId,
        data: responseData,
        submittedAt: new Date().toISOString()
      };

      setResponses(prev => [...prev, newResponse]);
      toast.success('Response submitted successfully!');
      return { success: true, response: newResponse };
    } catch (error) {
      toast.error(error.message || 'Failed to submit response');
      return { success: false, error: error.message };
    } finally {
      setLoading(false);
    }
  };

  const getFormById = (formId) => {
    return forms.find(form => form.id === formId);
  };

  const getFormResponses = (formId) => {
    return responses.filter(response => response.formId === formId);
  };

  const getUserResponses = (userId) => {
    return responses.filter(response => response.userId === userId);
  };

  const getActiveForms = () => {
    return forms.filter(form => form.isActive);
  };

  const getFormResponseCount = (formId) => {
    return responses.filter(response => response.formId === formId).length;
  };

  const hasUserResponded = (formId, userId) => {
    return responses.some(response => 
      response.formId === formId && response.userId === userId
    );
  };

  const value = {
    forms,
    responses,
    loading,
    createForm,
    updateForm,
    deleteForm,
    submitResponse,
    getFormById,
    getFormResponses,
    getUserResponses,
    getActiveForms,
    getFormResponseCount,
    hasUserResponded
  };

  return (
    <FormContext.Provider value={value}>
      {children}
    </FormContext.Provider>
  );
};
